  \"2015-09-01T18:08:06.742608\",\n\t\"name\": \"community-eligibility-provision-evaluation\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Healthy, Hunger-Free Kids Act (HHFKA)
  provided schools and districts that predominately serve low-income children with
  a new option for meal certification.  Under the Community Eligibility Provision,
  schools do not collect or process meal applications for free and reduced-price meals
  served in the National School Lunch Program and School Breakfast Program.  Schools
  must serve all meals at no cost with any costs in excess of the Federal reimbursement
  paid from non-Federal sources.  The evaluation, mandated by HHFKA, examined the
  implementation and impacts of the Community Eligibility Provision.\",\n\t\"license_title\":
